import React from "react";
import styled from "styled-components";

const ChampionListPageWrapper=styled.div`
    display: flex;
    width:1000px;
    margin:0 auto;
    margin-top:100px;
`
const ChampionListWrapper = styled.div`
    flex:2;
`
const ChampionTrendWrapper=styled.div`
    flex:1;
    background-color: red;
`
const ChampionsWrapper=styled.div`
    flex:2;
    background-color: white;
    &>.header{
        display: flex;;
        justify-content: space-between;;
    }
    &>.header>.item-wrap{
        display: flex;
    }
    &>.header>.item-wrap>.item{
        line-height: 60px;
        margin:0 12px;
    }
`
// List of champion page
export default class ChampionsList extends React.Component {
    render() {
        return (
            <ChampionListPageWrapper>
                <ChampionListWrapper>
                    <div className="header">
                        <div className="item-wrap">
                            <div className="item">전체</div>
                            <div className="item">탑</div>
                            <div className="item">정글</div>
                            <div className="item">미드</div>
                            <div className="item">바텀</div>
                            <div className="item">서포터</div>
                        </div>
                        <input type="text" placeholder="챔피언 선택 (가렌, ㄱㄹ, ...)"/>
                    </div>
                </ChampionListWrapper>
                <ChampionTrendWrapper>
                    trends
                </ChampionTrendWrapper>
            </ChampionListPageWrapper>
        )
    }
}


const ChampionListHeader:React.FC<{}>=()=>{
    return (
        <div>

        </div>
    )
}
